					<div class="stl_01" style="left:20.6335em;top:7.085em;"><span class="stl_10 stl_08 stl_11">AFFIDAVIT </span></div>
					<div class="stl_01" style="left:5.9996em;top:9.0504em;"><span class="stl_12 stl_08 stl_13" style="word-spacing:-0.0004em;">For obtaining passport and consular services (other than changing photo to match </span></div>
