					<div class="stl_01" style="left:8.9981em;top:41.1858em;"><span class="stl_16 stl_08 stl_27">U.K </span></div>
					<div class="stl_01" style="left:7.4976em;top:42.3953em;"><span class="stl_16 stl_08 stl_28" style="word-spacing:0.39em;">(f) I</span><span class="stl_16 stl_08 stl_18" style="word-spacing:0.143em;"></span><span class="stl_16 stl_08 stl_19" style="word-spacing:0.1435em;">have entered illegally/ entered legally into UK. I’m mentioning the circumstances of my </span></div>
